description:
Muziek voor je Moeder van rapper steen is een erg sterk album, van een rasechte Utrechter.

De sound is rauw en de lyrics af en toe zelfs vulgair, maar dat is Steen. Steen heeft met zijn onconventionele stijl definitief een plaats veroverd in de Nederlandse scene. 

Niet alleen door zijn hilarische media optredens, maar ook door een steengoed album af te leveren!

